import classes from "./AvailableMeals.module.css";
import california from "../images/california.png"
import dragon from "../images/dragon.png"
import dynamite from "../images/dynamite.png"
import philadelphia from "../images/philadelphia.png"
import shrimp from "../images/shrimp.png"
import lipton from "../images/lipton.jpg"
import fanta from "../images/fanta.jpg"
import liptonGreen from "../images/liptonGreen.jpg"
import cocacola from "../images/coca-cola.jpg"
import cocazero from "../images/cocazero.jpg"
import Card from "../UI/Card";
const Dummy_Drink=[
  {
    id: Math.random(),
    name: "Lipton Ice-tea®",
    price: 1.99,
    src:lipton,
  },
  {
    id: Math.random(),
    name: "Lipton® Green Ice Tea",
    price: 1.99,
    src:liptonGreen,
  },
  {
    id: Math.random(),
    name: "Coca-Cola®",
    price: 1.99,
    src:cocacola,
  },
  {
    id: Math.random(),
    name: "Fanta®",
    price: 1.99,
    src:fanta,
  },
  {
    id: Math.random(),
    name: "Coca-Cola® Zero",
    price: 1.99,
    src:cocazero,
  },
]
const DUMMY_Sushi = [
  {
    id: "m1",
    name: "Sushi",
    description: "Finest fish and veggies",
    price: 22.99,
    src:california,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "A german specialty!",
    price: 16.5,
    src:dragon
  },
  {
    id: "m3",
    name: "Barbecue ",
    description: "American, raw, meaty",
    price: 12.99,
    src:philadelphia,
  },
  {
    id: "m4",
    name: "Green Bowl",
    description: "Healthy...and green...",
    price: 18.99,
    src:dynamite,
  },
  {
    id: "m5",
    name: "Burger",
    description: "Healthy...",
    price: 18.99,
    src:shrimp,
  },
];
const AvailableMeals = () => {
  const ListofMeals = DUMMY_Sushi.map((meal) => (
    <Card key={meal.id} id={meal.id} name={meal.name} description={meal.description} price={meal.price}src={meal.src}/>
  ));
  const ListofDrink = Dummy_Drink.map((meal) => (
    <Card key={meal.id} id={meal.id} name={meal.name} price={meal.price}src={meal.src}/>
  ));
  return (
    <section className={classes.meals}>
    <ul className="row">{ListofMeals}</ul>
    <ul className="row">{ListofDrink}</ul>
    </section>
  );
};
export default AvailableMeals;
